import React from "react";

const Game = () => {
  const games = [
    {
      id: 1,
      name: "Monopoly",
      image: "https://www.example.com/monopoly.png",
      scoreCount: 3,
    },
    {
      id: 2,
      name: "Scrabble",
      image: "https://www.example.com/scrabble.png",
      scoreCount: 5,
    },
    {
      id: 3,
      name: "Chess",
      image: "https://www.example.com/chess.png",
      scoreCount: 2,
    },
  ];
  return <div></div>;
};

export default Game;
